import { useState } from "react";
import emailjs from "emailjs-com";
import React from "react";

const initialState = {
  name: "",
  email: "",
  message: "",
};

export const Contact = (props) => {
  const [{ name, email, message }, setState] = useState(initialState);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setState((prevState) => ({ ...prevState, [name]: value }));
  };

  const clearState = () => setState({ ...initialState });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(name, email, message);

    // Replace with your EmailJS credentials
    emailjs
      .sendForm("YOUR_SERVICE_ID", "YOUR_TEMPLATE_ID", e.target, "YOUR_PUBLIC_KEY")
      .then(
        (result) => {
          console.log(result.text);
          clearState();
        },
        (error) => {
          console.log(error.text);
        }
      );
  };

  return (
    <div id="contact">
      <div className="container-fluid">
        <div className="row section-title text-center mb-5">
          <div className="col-md-12">
            <h2>Get In Touch</h2>
            <p>
              At K & H Associates, we provide expert chartered accounting services. Whether you're a business or an individual,
              we’re here to ensure your financial affairs are managed efficiently and effectively.
            </p>
            <p>Please fill out the form below to send us an email and we will get back to you as soon as possible.</p>
          </div>
        </div>

        <div className="row justify-content-center">
          <div className="col-md-8">
            <form name="sentMessage" validate="true" onSubmit={handleSubmit}>
              <div className="row">
                <div className="col-md-6 mb-3">
                  <input
                    type="text"
                    id="name"
                    name="name"
                    className="form-control"
                    placeholder="Name"
                    required
                    onChange={handleChange}
                    value={name}
                  />
                </div>
                <div className="col-md-6 mb-3">
                  <input
                    type="email"
                    id="email"
                    name="email"
                    className="form-control"
                    placeholder="Email"
                    required
                    onChange={handleChange}
                    value={email}
                  />
                </div>
              </div>
              <div className="mb-3">
                <textarea
                  name="message"
                  id="message"
                  className="form-control"
                  rows="4"
                  placeholder="Message"
                  required
                  onChange={handleChange}
                  value={message}
                ></textarea>
              </div>
              <div className="text-center">
                <button type="submit" className="btn btn-custom btn-lg">
                  Send Message
                </button>
              </div>
            </form>
          </div>

          <div className="col-md-4 mt-5 mt-md-0">
            <div className="contact-info">
              <h3>Contact Info</h3>
              <p>
                <i className="fa fa-map-marker"></i>{" "}
                {props.data ? props.data.address : "Loading..."}
              </p>
              <p>
                <i className="fa fa-phone"></i>{" "}
                {props.data ? props.data.phone : "Loading..."}
              </p>
              <p>
                <i className="fa fa-envelope-o"></i>{" "}
                {props.data ? props.data.email : "Loading..."}
              </p>

              <div className="social mt-4">
                <ul className="list-inline">
                  <li className="list-inline-item">
                    <a href={props.data?.facebook || "/"}>
                      <i className="fa fa-facebook"></i>
                    </a>
                  </li>
                  <li className="list-inline-item">
                    <a href={props.data?.twitter || "/"}>
                      <i className="fa fa-twitter"></i>
                    </a>
                  </li>
                  <li className="list-inline-item">
                    <a href={props.data?.youtube || "/"}>
                      <i className="fa fa-youtube"></i>
                    </a>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>

      <div id="footer" className="mt-5">
        <div className="container text-center">
          <p>
            &copy; 2023 Issaaf Kattan React Land Page Template. Design by{" "}
            <a href="http://www.templatewire.com" rel="nofollow">
              TemplateWire
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};
